class Submission:
    def __init__(self, content, files):
        self.content = content
        self.files = files
        self.is_valid = False

    def validate(self, validation_rules):
        for rule in validation_rules:
            if not rule(self.content):
                self.is_valid = False
                return
        self.is_valid = True


class ValidationRule:
    def __init__(self, rule_function):
        self.rule_function = rule_function

    def __call__(self, content):
        return self.rule_function(content)


class SubmissionManager:
    def __init__(self):
        self.submissions = []
        self.validation_rules = []

    def add_validation_rule(self, rule):
        self.validation_rules.append(rule)

    def submit(self, submission):
        submission.validate(self.validation_rules)
        if submission.is_valid:
            self.store_submission(submission)
            return "Submission successful"
        else:
            return "Submission failed validation"

    def store_submission(self, submission):
        self.submissions.append(submission)


class FileUploader:
    def __init__(self):
        self.uploaded_files = []

    def upload(self, file):
        self.uploaded_files.append(file)
        return f"Uploaded file: {file}"


class FileDownloader:
    def download(self, file):
        return f"Downloaded file: {file}"


class User:
    def __init__(self, user_type):
        self.user_type = user_type


# Example usage

# Validation rules
def check_content_length(content):
    return len(content) > 0

def check_file_format(files):
    allowed_formats = ['pdf', 'docx', 'jpg']
    return all(file.split('.')[-1] in allowed_formats for file in files)

validation_rule_length = ValidationRule(check_content_length)
validation_rule_format = ValidationRule(check_file_format)

submission_manager = SubmissionManager()
submission_manager.add_validation_rule(validation_rule_length)
submission_manager.add_validation_rule(validation_rule_format)

# Agency User submits a submission
agency_user = User("Agency")
submission = Submission(content="This is a test submission.", files=["document.pdf"])
result = submission_manager.submit(submission)
print(result)

# Broker User uploads files
